CREATE OR REPLACE VIEW BILLCHKOW.FIN_CCI_FACT_VIEW
(
 CURR_TIME_ID,CAPTN_ID,GEO_ID,CYCLE_ID,AMOUNT_CURR_MONTH,QTT_ITEMS_CURR_MONTH,AMOUNT_PREV_MONTH1,QTT_ITEMS_PREV_MONTH1,AMOUNT_PREV_MONTH2,
 QTT_ITEMS_PREV_MONTH2,AMOUNT_PREV_MONTH3,QTT_ITEMS_PREV_MONTH3,PARAMETER_AMOUNT,PARAMETER_ITEM,AMOUNT_AVG,QTT_ITEMS_AVG,DESVIO_VALOR,DESVIO_ITEMS
) AS
( 
  SELECT 
    CURR_TIME_ID, CAPTN_ID, GEO_ID, CYCLE_ID, AMOUNT_CURR_MONTH, QTT_ITEMS_CURR_MONTH, AMOUNT_PREV_MONTH1, QTT_ITEMS_PREV_MONTH1, AMOUNT_PREV_MONTH2,   QTT_ITEMS_PREV_MONTH2, AMOUNT_PREV_MONTH3, QTT_ITEMS_PREV_MONTH3, PARAMETER_AMOUNT, PARAMETER_ITEM,
    (AMOUNT_PREV_MONTH1+AMOUNT_PREV_MONTH2+AMOUNT_PREV_MONTH3)/3 as AMOUNT_AVG, (QTT_ITEMS_PREV_MONTH1+QTT_ITEMS_PREV_MONTH2+QTT_ITEMS_PREV_MONTH3)/3 as QTT_ITEMS_AVG,
   SQRT ( (power( (AMOUNT_PREV_MONTH1 - (AMOUNT_PREV_MONTH1+AMOUNT_PREV_MONTH2+AMOUNT_PREV_MONTH3)/3), 2 ) + power( (AMOUNT_PREV_MONTH2 - (AMOUNT_PREV_MONTH1+AMOUNT_PREV_MONTH2+AMOUNT_PREV_MONTH3)/3), 2) + power( (AMOUNT_PREV_MONTH3 - (AMOUNT_PREV_MONTH1+AMOUNT_PREV_MONTH2+AMOUNT_PREV_MONTH3)/3), 2))/2 ) as DESVIO_VALOR,
 SQRT ( (power( (QTT_ITEMS_PREV_MONTH1 - (QTT_ITEMS_PREV_MONTH1+QTT_ITEMS_PREV_MONTH2+QTT_ITEMS_PREV_MONTH3)/3), 2 ) + power( (QTT_ITEMS_PREV_MONTH2 - (QTT_ITEMS_PREV_MONTH1+QTT_ITEMS_PREV_MONTH2+QTT_ITEMS_PREV_MONTH3)/3), 2) + power( (QTT_ITEMS_PREV_MONTH3 - (QTT_ITEMS_PREV_MONTH1+QTT_ITEMS_PREV_MONTH2+QTT_ITEMS_PREV_MONTH3)/3), 2))/2 ) as DESVIO_ITEMS
  FROM 
(
  SELECT 
    A.LAST_BILL_DATE as CURR_TIME_ID, A.CAPTN_ID, A.GEO_ID, A.CYCLE_ID, A.AMOUNT as AMOUNT_CURR_MONTH, A.QTT_ITEMS as QTT_ITEMS_CURR_MONTH,
    nvl((select AMOUNT from BILLCHKOW.FIN_CCI_FACT B
      where A.CAPTN_ID = B.CAPTN_ID
      AND A.GEO_ID = B.GEO_ID
      AND A.CYCLE_ID = B.CYCLE_ID
      AND extract(month from B.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-1))
    ), 0) as AMOUNT_PREV_MONTH1,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_CCI_FACT B
      where A.CAPTN_ID = B.CAPTN_ID
      AND A.GEO_ID = B.GEO_ID
      AND A.CYCLE_ID = B.CYCLE_ID
      AND extract(month from B.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-1))
    ), 0) as QTT_ITEMS_PREV_MONTH1,
    nvl((select AMOUNT from BILLCHKOW.FIN_CCI_FACT C
      where A.CAPTN_ID = C.CAPTN_ID
      AND A.GEO_ID = C.GEO_ID
      AND A.CYCLE_ID = C.CYCLE_ID
      AND extract(month from C.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-2))
    ), 0) as AMOUNT_PREV_MONTH2,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_CCI_FACT C
     where A.CAPTN_ID = C.CAPTN_ID
      AND A.GEO_ID = C.GEO_ID
      AND A.CYCLE_ID = C.CYCLE_ID
      AND extract(month from C.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-2))
    ), 0) as QTT_ITEMS_PREV_MONTH2,
    nvl((select AMOUNT from BILLCHKOW.FIN_CCI_FACT D
     where A.CAPTN_ID = D.CAPTN_ID
      AND A.GEO_ID = D.GEO_ID
     AND A.CYCLE_ID = D.CYCLE_ID
      AND extract(month from D.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-3))
    ), 0) as AMOUNT_PREV_MONTH3,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_CCI_FACT D
      where A.CAPTN_ID = D.CAPTN_ID
      AND A.GEO_ID = D.GEO_ID
      AND A.CYCLE_ID = D.CYCLE_ID
      AND extract(month from D.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-3))
    ), 0) as QTT_ITEMS_PREV_MONTH3,
    nvl((select PARAMETER_AMOUNT from BILLCHKOW.FIN_REPORT_PARAMETER_DM PA
      where PA.TYPE_REPORT = 'FIN_CCI'
    ), 0) as PARAMETER_AMOUNT,
    nvl((select PARAMETER_ITEM from BILLCHKOW.FIN_REPORT_PARAMETER_DM PA
      where PA.TYPE_REPORT = 'FIN_CCI'
    ), 0) as PARAMETER_ITEM
  FROM BILLCHKOW.FIN_CCI_FACT A, BILLCHKOW.FIN_CONTROL_PROCESS CP
  WHERE A.LAST_BILL_DATE = (SELECT MAX(LAST_BILL_DATE) FROM BILLCHKOW.FIN_CCI_FACT LAST WHERE LAST.CYCLE_ID = A.CYCLE_ID)
        AND A.CONTROL_ID = CP.OBJID
        AND CP.OBJID=(SELECT MAX(OBJID) FROM BILLCHKOW.FIN_CONTROL_PROCESS WHERE ARCHIVE_ID=CP.ARCHIVE_ID)    
));

CREATE OR REPLACE VIEW BILLCHKOW.FIN_ROC_REL_FACT_VIEW 
(
 CURR_TIME_ID, CAPTN_ID, GEO_ID, CYCLE_ID, ROC_AMOUNT_CURR_MONTH, ROC_QTT_ITEMS_CURR_MONTH, ROC_AMOUNT_PREV_MONTH1, ROC_QTT_ITEMS_PREV_MONTH1,   ROC_AMOUNT_PREV_MONTH2, ROC_QTT_ITEMS_PREV_MONTH2, ROC_AMOUNT_PREV_MONTH3, ROC_QTT_ITEMS_PREV_MONTH3, PARAMETER_AMOUNT, PARAMETER_ITEM,   ROC_AMOUNT_AVG, ROC_QTT_ITEMS_AVG, REL_AMOUNT_CURR_MONTH, REL_QTT_ITEMS_CURR_MONTH, REL_AMOUNT_PREV_MONTH1,REL_QTT_ITEMS_PREV_MONTH1,  REL_AMOUNT_PREV_MONTH2, REL_QTT_ITEMS_PREV_MONTH2, REL_AMOUNT_PREV_MONTH3, REL_QTT_ITEMS_PREV_MONTH3, REL_AMOUNT_AVG, REL_QTT_ITEMS_AVG
) AS
( 
  SELECT 
    CURR_TIME_ID, CAPTN_ID, GEO_ID, CYCLE_ID, ROC_AMOUNT_CURR_MONTH, ROC_QTT_ITEMS_CURR_MONTH, ROC_AMOUNT_PREV_MONTH1, ROC_QTT_ITEMS_PREV_MONTH1,  ROC_AMOUNT_PREV_MONTH2, ROC_QTT_ITEMS_PREV_MONTH2, ROC_AMOUNT_PREV_MONTH3, ROC_QTT_ITEMS_PREV_MONTH3, PARAMETER_AMOUNT, PARAMETER_ITEM,
    (ROC_AMOUNT_PREV_MONTH1+ROC_AMOUNT_PREV_MONTH2+ROC_AMOUNT_PREV_MONTH3)/3 as ROC_AMOUNT_AVG,
 (ROC_QTT_ITEMS_PREV_MONTH1+ROC_QTT_ITEMS_PREV_MONTH2+ROC_QTT_ITEMS_PREV_MONTH3)/3 as ROC_QTT_ITEMS_AVG,REL_AMOUNT_CURR_MONTH,   REL_QTT_ITEMS_CURR_MONTH, REL_AMOUNT_PREV_MONTH1, REL_QTT_ITEMS_PREV_MONTH1, REL_AMOUNT_PREV_MONTH2,    REL_QTT_ITEMS_PREV_MONTH2,REL_AMOUNT_PREV_MONTH3, REL_QTT_ITEMS_PREV_MONTH3,
 (REL_AMOUNT_PREV_MONTH1+REL_AMOUNT_PREV_MONTH2+REL_AMOUNT_PREV_MONTH3)/3 as REL_AMOUNT_AVG,  (REL_QTT_ITEMS_PREV_MONTH1+REL_QTT_ITEMS_PREV_MONTH2+REL_QTT_ITEMS_PREV_MONTH3)/3 as REL_QTT_ITEMS_AVG
  FROM 
(
  SELECT 
 LAST_BILL_DATE as CURR_TIME_ID, CAPTN_ID, GEO_ID, CYCLE_ID, AMOUNT as ROC_AMOUNT_CURR_MONTH, QTT_ITEMS as ROC_QTT_ITEMS_CURR_MONTH,
  nvl((select AMOUNT from BILLCHKOW.FIN_ROC_FACT B
      where A.CAPTN_ID = B.CAPTN_ID
      AND A.GEO_ID = B.GEO_ID
      AND A.CYCLE_ID = B.CYCLE_ID
      AND extract(month from B.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-1))
    ), 0) as ROC_AMOUNT_PREV_MONTH1,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_ROC_FACT B
      where A.CAPTN_ID = B.CAPTN_ID
      AND A.GEO_ID = B.GEO_ID
      AND A.CYCLE_ID = B.CYCLE_ID
      AND extract(month from B.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-1))
    ), 0) as ROC_QTT_ITEMS_PREV_MONTH1,
    nvl((select AMOUNT from BILLCHKOW.FIN_ROC_FACT C
      where A.CAPTN_ID = C.CAPTN_ID
      AND A.GEO_ID = C.GEO_ID
      AND A.CYCLE_ID = C.CYCLE_ID
      AND extract(month from C.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-2))
    ), 0) as ROC_AMOUNT_PREV_MONTH2,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_ROC_FACT C
      where A.CAPTN_ID = C.CAPTN_ID
      AND A.GEO_ID = C.GEO_ID
      AND A.CYCLE_ID = C.CYCLE_ID
      AND extract(month from C.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-2))
    ), 0) as ROC_QTT_ITEMS_PREV_MONTH2,
    nvl((select AMOUNT from BILLCHKOW.FIN_ROC_FACT D
      where A.CAPTN_ID = D.CAPTN_ID
      AND A.GEO_ID = D.GEO_ID
      AND A.CYCLE_ID = D.CYCLE_ID
      AND extract(month from D.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-3))
    ), 0) as ROC_AMOUNT_PREV_MONTH3,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_ROC_FACT D
      where A.CAPTN_ID = D.CAPTN_ID
      AND A.GEO_ID = D.GEO_ID
      AND A.CYCLE_ID = D.CYCLE_ID
      AND extract(month from D.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-3))
    ), 0) as ROC_QTT_ITEMS_PREV_MONTH3,
     nvl((select AMOUNT from BILLCHKOW.FIN_REL_FACT E
      where A.CAPTN_ID = E.CAPTN_ID
      AND A.GEO_ID = E.GEO_ID
      AND A.CYCLE_ID = E.CYCLE_ID
      AND extract(month from E.LAST_BILL_DATE) = extract(month from A.LAST_BILL_DATE)
    ), 0) as REL_AMOUNT_CURR_MONTH,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_REL_FACT E
      where A.CAPTN_ID = E.CAPTN_ID
      AND A.GEO_ID = E.GEO_ID
      AND A.CYCLE_ID = E.CYCLE_ID
      AND extract(month from E.LAST_BILL_DATE) = extract(month from A.LAST_BILL_DATE)
    ), 0) as REL_QTT_ITEMS_CURR_MONTH,
     nvl((select AMOUNT from BILLCHKOW.FIN_REL_FACT F
      where A.CAPTN_ID = F.CAPTN_ID
      AND A.GEO_ID = F.GEO_ID
      AND A.CYCLE_ID = F.CYCLE_ID
      AND extract(month from F.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-1))
    ), 0) as REL_AMOUNT_PREV_MONTH1,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_REL_FACT F
      where A.CAPTN_ID = F.CAPTN_ID
      AND A.GEO_ID = F.GEO_ID
      AND A.CYCLE_ID = F.CYCLE_ID
      AND extract(month from F.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-1))
    ), 0) as REL_QTT_ITEMS_PREV_MONTH1,
    nvl((select AMOUNT from BILLCHKOW.FIN_REL_FACT G
      where A.CAPTN_ID = G.CAPTN_ID
      AND A.GEO_ID = G.GEO_ID
      AND A.CYCLE_ID = G.CYCLE_ID
      AND extract(month from G.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-2))
    ), 0) as REL_AMOUNT_PREV_MONTH2,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_REL_FACT G
      where A.CAPTN_ID = G.CAPTN_ID
      AND A.GEO_ID = G.GEO_ID
      AND A.CYCLE_ID = G.CYCLE_ID
      AND extract(month from G.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-2))
    ), 0) as REL_QTT_ITEMS_PREV_MONTH2,
    nvl((select AMOUNT from BILLCHKOW.FIN_REL_FACT H
      where A.CAPTN_ID = H.CAPTN_ID
      AND A.GEO_ID = H.GEO_ID
      AND A.CYCLE_ID = H.CYCLE_ID
      AND extract(month from H.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-3))
    ), 0) as REL_AMOUNT_PREV_MONTH3,
    nvl((select QTT_ITEMS from BILLCHKOW.FIN_REL_FACT I
      where A.CAPTN_ID = I.CAPTN_ID
      AND A.GEO_ID = I.GEO_ID
      AND A.CYCLE_ID = I.CYCLE_ID
      AND extract(month from I.LAST_BILL_DATE) = extract(month from add_months(A.LAST_BILL_DATE,-3))
    ), 0) as REL_QTT_ITEMS_PREV_MONTH3,
     nvl((select PARAMETER_AMOUNT from BILLCHKOW.FIN_REPORT_PARAMETER_DM PA
      where PA.TYPE_REPORT = 'FIN_ROC_REL'
    ), 0) as PARAMETER_AMOUNT,
   nvl((select PARAMETER_ITEM from BILLCHKOW.FIN_REPORT_PARAMETER_DM PA
      where PA.TYPE_REPORT = 'FIN_ROC_REL'
   ), 0) as PARAMETER_ITEM
  FROM BILLCHKOW.FIN_ROC_FACT A
  WHERE A.LAST_BILL_DATE = (SELECT MAX(LAST_BILL_DATE) FROM BILLCHKOW.FIN_ROC_FACT LAST WHERE LAST.CYCLE_ID = A.CYCLE_ID)
 ));

