/
Comment on column BILLCHKOW."TB_ACCOUNT"."TIPO_FATURA" is 'Tipo da Fatura, se fatura eletronica, febraban, etc...'
/
Comment on column BILLCHKOW."TB_ACCOUNT"."CLASSE_CREDITO_CONTA" is 'Classe de Crédito da Conta'
/
Comment on column BILLCHKOW."TB_ACCOUNT"."IND_HELD" is 'Indicador de HEL_BILL'
/
Comment on column BILLCHKOW."TB_ACCOUNT"."IND_DORMANT" is 'Indicador de DORMANT'
/
Comment on column BILLCHKOW."TB_ACCOUNT"."NOME_EMPRESA" is 'Nome da Empresa'
/
Comment on column BILLCHKOW."TB_ACCOUNT"."MAINTAIN_STATUS" is 'This Column can have the following Values:
N: Nothing Has being Done
W:Working in Progress
F:User has finished its working
U:Data has Being Uploaded FULLY to Atlys
E:Data has being Uploaded PARTIALLY to Atlys (Some errors Had happen)
'
